import React from "react";

export default function Header() {
  return (
    <header style={{
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "12px 20px",
      background: "#222",
      color: "#fff"
    }}>
      <h1>MyStore</h1>
      <button style={{
        background: "#007bff",
        color: "#fff",
        border: "none",
        padding: "8px 12px",
        borderRadius: "4px",
        cursor: "pointer"
      }}>
        Cart (0)
      </button>
    </header>
  );
}
